# Rime字典: en_ext
#
# 作者：樊永彪
# 从搜狗细胞词库经深蓝词典转换为纯文本，再经编码为新世纪五笔。
# 本dict为北京的文言和所有地铁站名，和通州的村名。
# 本词典为个人需要的词典，你如果不需要可以删除或添加其它词典，记得修改主目录下的wubixinshiji.dict.yaml下的import_tables项。


---
name: en_ext
version: "0.1"
sort: by_weight
# sort: original
columns:
  - text
  - code
  - weight
  - stem
encoder:
  exclude_patterns:
    - '^z.*$'
  rules:
    - length_equal: 2
      formula: "AaAbBaBb"
    - length_equal: 3
      formula: "AaBaCaCb"
    - length_in_range: [4, 10]
      formula: "AaBaCaZa"
...

